import React, { useState } from 'react';
import '../../App.css';
import { Link } from 'react-router-dom';

export default function Home() {
  const [isExpanded, setIsExpanded] = useState(false);

  const handleToggle = () => {
    setIsExpanded(!isExpanded);
  };

  return (
    <>
    <div className="home">
      <h1>O Mnie</h1>
      <div className="about-me"></div>
        <div className="container">
        <h1>Moje Projekty</h1>
          <div className="projekt1">
            <h1>Projekt1</h1>
            <img src="" alt="Upsss"></img>
            <button onClick={handleToggle}>Rozwiń/Zwiń opis</button>
            {isExpanded && <p>Opis</p>}
            <Link to="/marketing"><button>Przejdź do Marketing</button></Link>
          </div>
        </div>
      </div>
    </>
  );
}
